  var browser = chrome;
}
function App() {
window.addEventListener('scroll', () =>{
  const scrolled = window.scrollY;
  var aTop = $('#aboutMe').height();
  if(scrolled >= aTop){
    <Typewriter
    onInit={(typewriter)=> {
    typewriter
    .typeString("About Me")
    .start();
    }}
    />

  }

});

  return (
  <>
  

  <div id='intro'>
    <div id='name'>
      <div className="bouncing-text">
        <div className="b">h</div>
        <div className="o">i</div>
        <div className="u">,</div>
      </div>
